%pyspark
def conta_pares_marcas(item):
    lista = ["adidas","nike","puma"]
    listaRet = []
    for marca in lista:
        if marca in item[1].lower():
            for marca2 in lista:
                if marca < marca2:
                    if marca2 in item[1].lower():
                        listaRet.append(((marca,marca2),1))
    return listaRet

%pyspark
def conta_pares_dominio(item):
    dominio = urlparse(item[0]).netloc
    lista = ["adidas","nike","puma"] 
    listaRet = []
    for marca in lista:
        if marca in item[1].lower():
            listaRet.append(((marca,dominio),1))
    return listaRet
